    const [posts, setPosts] = useState([]);
    
    useEffect(async () => {
        const result = await axios(
          'http://localhost:3000/posts/',
          );
          setPosts(result.posts);
        }, [])
       
  return (
    <div>
      {posts.map(post => (
        <li key={post._id}> {post.title} </li>
      ))}
    </div>
   
  );
}


export default Posts;
